import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import RightArrow from "../../Timesheet/calendarAssets/arrowR.png"

const ManageGroupLeft = () => {
    return (
        <div className="container">
            <h2 className="text-left" style={{ marginBottom: '30px' }}>Manage Group</h2>
            <h3 className="text-left">Group Name:</h3>
            <div className="row">
                <div className="col"></div>
                <input className="form-control me-2" placeholder="Name" aria-label="groupName" />
                <img src={RightArrow} className="bi" width="16" height="18" />
                <div/>
            </div>
        </div>  
    );
};

export default ManageGroupLeft;
